function menu_turun(){
$('ul#byusnrg_jsddm ul').css({'display':'none'});
$('ul#byusnrg_jsddm li').bind('mouseover', function(){
	$(this).find('ul:first').css({'display':'block'});
	});
$('ul#byusnrg_jsddm li').bind('mouseout', function(){
	$(this).find('ul:first').css({'display':'none'});
	});
};
function fungsi_umum(){
	$("ul#byusnrg_jsddm a").live('click',function(){
		hrf=$(this).attr('href');
		location.replace(hrf);
		return false;
	});
	$("div#divKeluar").live('click',function(){
		hrf="akadAkademikController.jsp?keluar=Keluar";
		location.replace(hrf);
		return false;
	});
/*	$("span#byusnrg_opsi_gnt").live('click',function(){
			gaya.pilih();
		return false;
	});*/
};
function fungsi_khusus(){
	var ptSc=window.location.pathname+window.location.search;
	$("input").each(function () {
	if ($(this).attr('value')=="Keluar"){
		$(this).replaceWith('<div id="divKeluar">' + $(this).attr('value')+ '</div>');
	}
	if ($(this).attr('value')=="Batal" && ptSc ==
		"/SinergiTEUB/akadAkademikController.jsp?akadType=BiodataMhs" ){
		$(this).replaceWith('<div id="divKeluar">' + $(this).attr('value')+ '</div>');
	}
	if ($(this).attr('value')=="Simpan" && ptSc ==
		"/SinergiTEUB/akadAkademikController.jsp?akadType=BiodataMhs" ){
		$(this).addClass('divKirim');
	}
});
};
