gaya = {
nama:GM_getValue('gaya_'+scr_id, 0),
awal:function(){
	GM_registerMenuCommand("Ubah gaya", function(){gaya.pilih();});
},
atur:function(aNama){
		if(aNama)this.nama=aNama;
		if(!this.nama){
			GM_setValue('gaya_'+scr_id,"aseli");
			this.nama="aseli";
			};
		if(this.nama=="pilihan"){
			byusnrg_status('Tema: Pilihan');
				menu_gaya_pilihan();
		}else{
				menu_gaya_aseli();
		};
	},
pilih:function(){
	var gya=GM_getValue('gaya_'+scr_id, 0);
		gya=(gya=="pilihan")?"aseli":"pilihan";
		GM_setValue('gaya_'+scr_id,gya);
	location.reload(true);
}
};
